import React from "react";
import "../style/logoInicio.css";
import logoSuperior from "../asserts/logo_alba_prado.svg"

const logoInicio = () => {
    return (
        <div id="logoInicio">
            <img src={logoSuperior} alt=""></img>
        </div>
    )
}

export default logoInicio;
